const dataRekapLesson = () =>{
    $.ajax({
        url: uri+"/cntlessontahap",
        type: "get",
        beforeSend: function()
        {
            $('.senddataloader').show();
        }
    })
        .done(function(data){
            if(data== ""){
                $('.senddataloader').hide();
                return;
            }

            $('.senddataloader').hide();
            getgraph3(data);
        })
        .fail(function(jqXHR, ajaxOptions, thrownError){
            $('.senddataloader').hide();
            alert('Server Not Responding.. , Please Refresh');
        });
}

